import React from 'react';
import Airbnb from "./image/Group 77.png"
import Airlogo from "./image/Airbnb-Logo.png"

export default function Navigationbar() {
  return (
    <div className="nav">
      <nav>
        <img src={Airlogo}
             alt="airbnblogo"
             className='navlogobnb'/>
      </nav>
      <main>
        <img src={Airbnb}
             alt="airbnbphoto"
             className='navbnb'/>
      </main>
    </div>
  );
}
